import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import MapComponent from './components/MapComponent';
import Login from './components/Login';
import Signup from './components/Signup';
import Home from './pages/Home';
import About from './pages/About';
import Contact from './pages/Contact';
import NoMatch from './pages/NoMatch';
import { Layout } from './components/Layout';
import { NavigationBar } from './components/NavigationBar';
import { Jumbotron } from './components/Jumbotron';
import './App.css';




export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isUserLoggedIn: false
    }
  }

 //Finds if user is logged in | passed down to login component: App.js -> Home.js -> Login.js
  getUserStatus(status) {
      if (this.status === true) {
      this.setState({
        isUserLoggedIn: true
      }) 
    } 
  }


  render() {
    return(
      <React.Fragment>
      <NavigationBar />

      {console.log('APP COMP A Test of grabbing user status', this.state.isUserLoggedIn)}
      <MapComponent userstatus={this.state.isUserLoggedIn} />
      <Login getUserStatus={(e) => this.getUserStatus(e)} 

            />
      <Layout>
        <Home />
      </Layout>
      <Signup />
        {console.log('APP COMP A Test of grabbing user status', this.state.isUserLoggedIn)}
      </React.Fragment>
      );
  }
}
